import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ExchangeRates = () => {
  const [exchangeRates, setExchangeRates] = useState({});

  useEffect(() => {
    const fetchExchangeRates = async () => {
      try {
        const response = await axios.get('https://api.iexcloud.io/stable/fx/latest?symbols=USDCAD,GBPUSD,USDJPY&token=pk_3a32cbeded39453aa11bc7fac06f97db/exchangeRates');
        // Make sure to replace 'YOUR_API_KEY' with your actual API key
        setExchangeRates(response.data);
      } catch (error) {
        console.error('Error fetching exchange rates:', error);
      }
    };

    fetchExchangeRates();
  }, []);

  return (
    <div>
      <h2>Currency Exchange Rates</h2>
      {/* Render exchange rates */}
      {/* <ul>
        {Object.entries(exchangeRates).map(([currency, rate]) => (
          <li key={currency}>
            {currency}: {rate}
          </li>
        ))}
      </ul> */}
      <ul>
        {exchangeRates.map((exchangeRates) => (
          <li key={exchangeRates.id}>{exchangeRates.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default ExchangeRates;
